import React, { Component } from 'react';

/* function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Hello World</h1>
      </header>
    </div>
  );
} */

class Todo extends Component {
  render(){
      console.log(this.props.todos);
    return this.props.todos.map((todo) => {
        <h1>{ todo.title }</h1>
    });
  }
}

export default Todo;
